import { createStore } from 'vuex';

const store = createStore({
    modules: {
      FormComponent: {
        namespaced: true,
        state() {
          return {
            Tipo: '',
          };
        },
        mutations: {
          setPropTipo(state, value) {
            state.Tipo = value;
          },
        },
      },
    },
  });

export default store;
